import React, { Component } from "react";
import "./project.scss";
export default class ProjectCard extends Component {
  constructor(props) {
    super(props);

    // this.deleteProjects = this.deleteProjects.bind(this)

    this.state = { Projects: [] };
  }
  render() {
    return (
      <div class="container">
        <div class="card">
          <img src="//unsplash.it/399/400" alt="" class="card-img"></img>
          <div class="card-text">
            <h3 class="card-title">{this.props.item.title}</h3>
            <p class=" card-body">{this.props.item.description}</p>
          </div>
        </div>
      </div>
    );
  }
}
